import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Header from './components/Header';
import './App.css';

function App() {
  return (
    <Router>
      <div className="App">
        <Header />
        <div style={{
          textAlign: 'center',
          padding: '4rem 2rem',
          background: 'linear-gradient(to right, #dc2626, white)',
          minHeight: '80vh'
        }}>
          <h1 style={{fontSize: '3rem', color: '#7f1d1d', marginBottom: '1rem'}}>
            Welcome to August 93 Club
          </h1>
          <p style={{fontSize: '1.5rem', color: '#991b1b'}}>
            A.K.A Ohanze Congress - Service for Advancement
          </p>
        </div>
      </div>
    </Router>
  );
}

export default App;
